import React from 'react'
import "./Card.css";
import Backlog from "../../assets/Backlog.svg";
import To_do from "../../assets/To_do.svg";
import in_progress from "../../assets/in_progress.svg";
import Done from "../../assets/Done.svg";
import Cancelled from "../../assets/Cancelled.svg";
import No_priority from "../../assets/No_priority.svg";
import Img_Low_Priority from "../../assets/Img_Low_Priority.svg"
import Img_Medium_Priority from "../../assets/Img_Medium_Priority.svg" 
import Img_High_Priority from "../../assets/Img_High_Priority.svg" 
import Urgent_Priority_grey from "../../assets/Urgent_Priority_grey.svg";


function Card({ id, title, tag, status, priority }) {
    const isStatus = localStorage.getItem("group") === "status";
    const isPriority = localStorage.getItem("group") === "priority";

    return (
        <div className='card'>
            <div className='cardHeading'>
                <span style={{ textTransform: "uppercase" }} className="color-grey">
                    {id}
                </span>
                <div
                    className="imageContainer relative"
                    style={{ width: "30px", height: "30px" }}
                >
                    <img
                        style={{ width: "95%", height: "95%", borderRadius: "50%" }}
                        // src="data:image/jpeg;base64,"
                        src="data:image/png;base64,<<OutputTruncated>>"
                        alt="UserImage"
                    />
                    <div className="showStatus"></div>
                    </div>

            </div>
            <div className='cardTitle'>
                {!isStatus &&
                    (
                        status === "Backlog" ? (
                        <img src={Backlog} alt="logo" style={{ marginBottom: "-2px"}}/>
                        ) :
                            status === "Todo" ? (
                            <img src={To_do} alt="logo" style={{ marginBottom: "-2px" }} />
                            ) :
                                status === "In progress" ? (
                                <img src={in_progress} alt="logo" style={{ marginBottom: "-2px" }} />
                                ) :
                                    status === "Done" ? (
                                    <img src={Done} alt="logo" style={{ marginBottom: "-2px" }} />
                                    ) :
                                        (
                                        <img src={Cancelled} alt="logo" style={{ marginBottom: "-2px" }} />
                                        )
                    )}
                <span style={{ marginLeft: "5px", fontWeight: 500 }}>{title}</span>
            </div>
            <div className='cardTags'>
                {!isPriority &&
                    (priority === 0 ? (
                    <img src={No_priority} alt="" />
                    ) :
                        priority === 1 ? (
                            <img src={Img_Low_Priority} alt="" />
                        ) :
                            priority === 2 ? (
                            <img src={Img_Medium_Priority} alt="" />
                            ) :
                                priority === 3 ? (
                                <img src={Img_High_Priority} alt="" />
                                ) :
                                    priority === 4 ? (
                                        <img src={Urgent_Priority_grey} alt="" />
                                    ) :
                                        (
                                            <p>.</p>
                                        )
                    )}
                {tag?.map((element, index) => {
                    return (
                        <div key={index} className="tags color-grey" style={{ marginBlock: "5px"}}>
                            {" "}
                            <span>â€¢</span> {element}
                            {" "}
                        </div>
                    );
                })}
            </div>
        </div>
    );
};

export default Card;
